void seduce_font_arial_init(SeduceRenderFont *font)
{
	SeduceFontCharacter *glyphs;
	RFormats vertex_format_types = R_FLOAT;
	uint i, j,  pos = 0;
	float *vertex_section;
	char *name = "arial";

	for(i = 0; name[i] != 0 && i < 31; i++)
		font->name[i] = name[i];
	font->name[i] = 0;
	i = 2;
	font->pool = r_array_allocate(SEDUCE_ARIAL_VERTEX_COUNT, &vertex_format_types, &i, 1, SEDUCE_ARIAL_REFERENCE_COUNT);
	vertex_section = r_array_section_allocate_vertex(font->pool, SEDUCE_ARIAL_VERTEX_COUNT); 
	r_array_load_vertex(font->pool, vertex_section, seduce_vertex_arial, 0, SEDUCE_ARIAL_VERTEX_COUNT);
	glyphs = malloc((sizeof *glyphs) * SEDUCE_ARIAL_GLYPH_COUNT);
	for(i = j = 0; i < SEDUCE_ARIAL_GLYPH_COUNT; i++)
	{
		glyphs[i].sections = r_array_section_allocate_reference(font->pool, seduce_ref_count_arial[i]);
		r_array_load_reference(font->pool, glyphs[i].sections, vertex_section, &seduce_ref_arial[j], seduce_ref_count_arial[i]);
		j += seduce_ref_count_arial[i];
	}
	for(i = j = 0; i < SEDUCE_ARIAL_GLYPH_COUNT; i++)
	{
		glyphs[i].size = 0;
		for(j = 0; j < 8; j++)
		{
			glyphs[i].kerning[j] = seduce_kerning_arial[i * 8 + j];
			if(glyphs[i].kerning[j] > glyphs[i].size)
				glyphs[i].size = glyphs[i].kerning[j];
		}
	}
	font->glyphs = malloc((sizeof *font->glyphs) * SEDUCE_ARIAL_CHARACTER_COUNT);
	for(i = 0; i < SEDUCE_ARIAL_CHARACTER_COUNT; i++)
		font->glyphs[i] = glyphs[seduce_lookup_arial[i * 2 + 1]];
	free(glyphs);
	seduce_font_load_construct_graph(font, seduce_lookup_arial, SEDUCE_ARIAL_CHARACTER_COUNT);
}
